"Palmolive туалетное твердое мыло Натурэль Витамин B и Гранат с 100% натуральным экстрактом граната, витамином B и увлажняющим компонентом дарит коже ощущение мягкости. Витамин B известен своими антиоксидантными свойствами, которые защищают кожу от сухости и замедляют ее старение.

- Формула твердого мыла обогощена 100% натуральными ингредиентами;
- Подходит для лица и тела;
- Содержит 100% натуральный экстракт граната и 100% натуральные масла;
- Содержит увлажняющий компонент;
- Не содержит парабенов и силиконов;
- Перерабатываемая упаковка.
-Твердое мыло Palmolive произведено в Турции и соответствует международным стандартам качества
Для его применения: Вспенить. Нанести на влажную кожу и тщательно смыть. Избегать контакта с глазами. При попадании в глаза тщательно промыть водой. Только для наружного применения. Хранить в недоступном для детей месте."

